const Agents = () => {
    return ( 
        <div className="agents">
            <h2 className="font-bold text-2xl text-center my-3">Become an eNaira Agent</h2>
            <div className="flex">
                <img src="" alt="" />
                <div>
                    <h3 className="font-bold">Looking for how to make extra cash without stress?</h3>
                    <h4>As an eNaira agent, you will;</h4>
                  <i className="fa fa-check-square" ></i>  <p>Earn passive income while you focus on your career</p>
                    <p>Create business for yourself without the stress of getting POS</p>
                    <p>Make transactions without hidden costs or charges</p>
                    <p>Make transactions without fear of dispensing error</p>
                    <button>Click here to become an agent</button>
                </div>
            </div>
        </div>
     );
}

export default Agents;
